import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import './Home.css';

const Home = () => {
  const [searchTerm, setSearchTerm] = useState('');
  const navigate = useNavigate();

  const categories = [
    { name: 'Property', icon: 'ðŸ ', slug: 'property', description: 'Houses, apartments, and commercial spaces', color: '#00bfff' },
    { name: 'Vehicles', icon: 'ðŸš—', slug: 'vehicles', description: 'Cars, bikes, and transportation', color: '#ff6b6b' },
    { name: 'Electronics', icon: 'ðŸ’»', slug: 'electronics', description: 'Gadgets, laptops, and tech devices', color: '#4ecdc4' },
    { name: 'Furniture', icon: 'ðŸª‘', slug: 'furniture', description: 'Home and office furniture', color: '#45b7d1' },
  ];

  const handleSearch = (e) => {
    e.preventDefault();
    if (searchTerm.trim()) {
      navigate(`/listings?search=${encodeURIComponent(searchTerm.trim())}`);
    } else {
      navigate('/listings');
    }
  };

  return (
    <div className="home">
      {/* Hero Section */}
      <section className="hero-section">
        <div className="hero-content">
          <h1>Rent Anything, Anytime</h1>
          <p>Discover amazing rental opportunities from trusted owners in your area</p>
          <form className="search-bar" onSubmit={handleSearch}>
            <input
              type="text"
              placeholder="What are you looking for?"
              className="search-input"
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
            />
            <button type="submit" className="search-btn">Search</button>
          </form>
          <div className="hero-actions">
            <Link to="/listings" className="cta-btn primary">Browse All Listings</Link>
            <Link to="/create-listing" className="cta-btn secondary">List Your Item</Link>
          </div>
        </div>
      </section>

      {/* Categories Section */}
      <section className="categories-section">
        <div className="container">
          <div className="section-header">
            <h2>Popular Categories</h2>
            <p>Explore items by category</p>
          </div>
          <div className="categories-grid">
            {categories.map((category) => (
              <Link
                key={category.slug}
                to={`/listings?category=${category.slug}`}
                className="category-card"
                style={{ '--category-color': category.color }}
              >
                <div className="category-icon">{category.icon}</div>
                <h3>{category.name}</h3>
                <p>{category.description}</p>
              </Link>
            ))}
          </div>
        </div>
      </section>

      {/* How It Works Section */}
      <section className="how-it-works-section">
        <div className="container">
          <div className="section-header">
            <h2>How It Works</h2>
            <p>Renting made simple in 3 easy steps</p>
          </div>
          <div className="steps-grid">
            <div className="step-card">
              <div className="step-number">1</div>
              <h3>Search & Discover</h3>
              <p>Browse thousands of rental listings in your area or search for specific items</p>
            </div>
            <div className="step-card">
              <div className="step-number">2</div>
              <h3>Connect & Book</h3>
              <p>Contact owners directly and arrange pickup or delivery</p>
            </div>
            <div className="step-card">
              <div className="step-number">3</div>
              <h3>Enjoy & Return</h3>
              <p>Use your rental and return it when you're done</p>
            </div>
          </div>
        </div>
      </section>

      {/* CTA Section */}
      <section className="cta-section">
        <div className="container">
          <div className="cta-content">
            <h2>Ready to Get Started?</h2>
            <p>Join thousands of users who trust RentLONA for their rental needs</p>
            <div className="cta-buttons">
              <Link to="/register" className="cta-btn primary">Sign Up Free</Link>
              <Link to="/listings" className="cta-btn secondary">Browse Listings</Link>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
};

export default Home;
